import React from "react";
import { Link,useNavigate } from "react-router-dom";
const Nav=()=>{
    const auth=localStorage.getItem('user');
    const navigate=useNavigate();
    const logout=()=>{
        localStorage.clear();
        
        navigate('/')
    }
    
    return(
        <div >
            <img className="" alt="logo" src="https://www.bing.com/images/search?view=detailV2&ccid=RomfcdTW&id=815AFB4076D442EF14D0FF884E5ABC7B7AC9549B&thid=OIP.RomfcdTWT4ldHhKhP8xBjQHaGm&mediaurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.46899f71d4d64f895d1e12a13fcc418d%3frik%3dm1TJenu8Wk6I%252fw%26riu%3dhttp%253a%252f%252f1.bp.blogspot.com%252f--wMBoBFp9vE%252fUkQrRS6-bGI%252fAAAAAAAAJOI%252fpEWENSIWXsI%252fs1600%252fShiva%252bAugust%252b2013.jpg%26ehk%3dHSm4YSAg1dkiPxp3qp53O4na4otg88A9gKT%252fLgCfMoE%253d%26risl%3d%26pid%3dImgRaw%26r%3d0&exph=855&expw=960&q=shiva&simid=607990374227052068&FORM=IRPRST&ck=62407C0FA7E13FCBDF265A4E03CBF139&selectedIndex=29&itb=0&ajaxhist=0&ajaxserp=0"/>
            {auth
                ? <ul className="nav-ul">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/profile">Profile</Link></li>
                <li><Link to="/add">Add Product</Link></li>
                <li><Link to="/remove">Remove Product</Link></li>
                <li> <Link onClick={logout} to="/login">Logout, {JSON.parse(auth).name}</Link></li>
                </ul>
                : <ul className="nav-ul rightnav">
                <li><Link to="/login">Login</Link> </li>
                <li><Link to="/register">SignUp</Link></li>
                </ul>
            }
        </div>
    )
}

export default Nav
